import React from "react";

const Input = (props) => {
const { label, errorr, name, onChange } = props;
const className = errorr ? "form-control is-invalid" : "form-control";

    return (
        <div className='mb-3'>
            <label>{label}</label>
            <input className={className} name={name} onChange={onChange} />
            <div className="invalid-feedback">{errorr}</div>
        </div>
    )
}

export default Input;
